package com.loops;

public class WhileLoopDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int count = 50;
		
		while(count>80){
			
			System.out.println("Values are " +count);
			
			count++;	
		}
		
		System.out.println("Values are not in the range");

	}

}
